import React, { Component } from 'react';
import './App.css';
import { profile } from './Config';

class ResumeNew extends Component {

    render() {
        const item = profile[0];
        console.log(item, "item");
        console.log(item.personalBD[0].Intro, "name")
        return (
            <div className="container">
                <div >

                    <div className="row">          
                        <div className="col-sm-12 col-md-5 col-lg-5  profile">
                            < img src={require('./woman.png')}
                                  alt="Avatar" />
                        </div>
                       
                        <div className="col-sm-12 col-md-7 col-lg-7 nameStyle">
                            {item.personalBD[0].firstName &&
                                <div  >
                                  <span>  {item.personalBD[0].firstName} </span>
                                </div>
                            }

                            <div className="roleStyle">
                                {item.personalBD[0].occupation &&
                                    <div>
                                        <span > {item.personalBD[0].occupation} </span>
                                    </div>
                                }
                            </div>
                        </div>
                    </div>
                    <div>
                        <div className="col-md-5 col-lg-5 col-sm-12">

                            {item.personalBD[0].Intro &&
                                <div>
                                    <span className = "keyStyle"> PROFILE  </span> <br/>
                                    <span className="descStyle">  {item.personalBD[0].Intro} </span>
                                </div>
                            }                           

                            {item.personalBD[0].phone &&
                                <div>
                                  <span className = "descStyle" ></span> {item.personalBD[0].phone}
                                </div>
                            }

                            {item.key3 &&
                                <div>
                                    <span className="keyStyle"> {item.key3} </span>
                                </div>
                            }

                            {item.description3 &&
                                <div className="descStyle">
                                    {item.description3}
                                </div>
                            }

                            {item.key4 &&
                                <div>
                                    <span className="keyStyle"> {item.key4} </span>
                                </div>
                            }

                            {item.description4 &&
                                <div className="descStyle">
                                    {item.description4}
                                </div>
                            }

                            {item.key5 &&
                                <div>
                                    <span className="keyStyle"> {item.key5} </span>
                                </div>
                            }

                            {item.description5 &&
                                <div className="descStyle">
                                    {item.description5}
                                </div>
                            }
                        </div>
                        <div className="col-md-7 col-lg-7 col-sm-12">

                            {item.key6 &&
                                <div>
                                    <span className="keyStyle1  border-bottom border-primary"> {item.key6} </span>
                                </div>
                            }

                            {item.description6 &&
                                <div className="descStyle">
                                    {item.description6}
                                </div>
                            }

                            {item.key7 &&
                                <div>
                                    <span className="keyStyle1 border-bottom border-primary"> {item.key7} </span>
                                </div>
                            }

                            {item.description7 &&
                                <div className="descStyle">
                                    {item.description7}
                                </div>
                            }

                            {item.key8 &&
                                <div>
                                    <span className="keyStyle1 border-bottom border-primary"> {item.key8} </span>
                                </div>
                            }

                            {item.description8 &&
                                <div className="descStyle">
                                    {item.description8}
                                </div>
                            }
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default ResumeNew;
